column8:
メーカー終売のため当店在庫限りです！<br>
<br>
ネコ砂が飛び散りにくい、フード付きの猫用脱臭トイレです！<br> 
本体とフードは取り外せるので分解して丸洗いできで清潔！<br>
ベルギー製のおしゃれなトイレです。<br>
※システムトイレではございません☆<br>
<br>
★今だけ送料540円引き★<br>
<br>
※ご注文いただいた後に手動でお代金を訂正いたしますのでご安心くださいませ。<br><style>
html, body {
    height: 100%;
    margin: 0;
    padding: 0;
}
.tab_ban2 {
    position: fixed!important;
    position: absolute;
}
.tab_ban2 {
    width: 100px;/* 最初に表示されるバナーの幅 */
    height: 87px;/* バナーの高さ */
    position: fixed;/* バナーを固定します */
    left: 0;/* 左から0pxの位置に指定 */
}
.tab_ban2 a {/* リンクするエリアをバナー全体に広げる設定 */
    display: block;
    width: 100%;
    height: 100%;
}
.tab_ban2:hover {/* カーソルが乗った時の動きを指定 */
    width: 300px;/* バナーが伸びた時の幅 */

    /* 以下アニメーションの設定 */
    -webkit-transition: width ease-in-out 0.4s;
    -moz-transition: width ease-in-out 0.4s;
    -ms-transition: width ease-in-out 0.4s;
    -o-transition: width ease-in-out 0.4s;
    transition: width ease-in-out 0.4s;
}
.tab_ban2 a:hover {
    /* IE9用 */
    width: 200px\9;
}
#tab01_left {
    background: url(http://image.rakuten.co.jp/orangecafe/cabinet/kanban1/left-bannar-puller.gif) right top no-repeat;
    bottom: 50px;
}

</style>
<div id="tab01_left" class="tab_ban2"> 
  <!-- /#tab_left.tab_ban --></div>

<!--タグバナー左ここまで-->

<style>


/*カート周り スタート*/

/* お買い物かごボタン */
td > input[type="submit"]{
font-size:16px;
font-weight:bold;
color:#ffffff;
padding:18px 63px;
width:250px;
height:60px;
background:url(http://image.rakuten.co.jp/orangecafe/cabinet/okaimonokago.jpg) #fcfcfc no-repeat;
cursor:pointer;
border-style:none;
margin:10px;
}


/* 「商品についての問い合わせ」ボタン */
font input {
font-size:14px;
font-weight:bold;
color:#666666;
padding:27px 58px;
width:250px;
height:60px;
background:url(http://image.rakuten.co.jp/orangecafe/cabinet/toiawase.jpg) #fcfcfc no-repeat;
cursor:pointer;
border-style:none;
}



/*お気に入り商品ボタン*/
div.bookmarkArea div.bkm a.addBkm span.bkmStar{
height: 42px !important;
background:url(http://image.rakuten.co.jp/orangecafe/cabinet/kanban1/btn_item.jpg) no-repeat 0 0 !important;
}

div.bookmarkArea div.bkm a.addBkm{
height: 42px !important;
}

/*お気に入りショップボタン*/
div.shopBookmarkArea div.shopBkm a.addShopBkm{
height: 42px !important;
background:url(http://image.rakuten.co.jp/orangecafe/cabinet/kanban1/btn_shop.jpg) no-repeat 0 0 !important;
}

div.shopBookmarkArea div.shopBkm a.addShopBkm span.shopBkmStar{
height: 42px !important;
background:url(http://image.rakuten.co.jp/xxxxxxxx/cabinet/sp_img02/btn_shop.jpg) no-repeat 0 0 !important;
}

/*選択項目肢*/
#rakutenLimitedId_aroundCart input[type="radio"]{
  width: 50%;
  height: 21px;
}

.inventory_choice_name{
  font-size:20px;
}

.inventory{
  text-align:center;
}

/*個数*/
#rakutenLimitedId_aroundCart input[type="text"]{
  font-size:20px;
  padding:5px;
}

span.unit {
  color: #000;
  font-size: 150%!important;
}

/*売り切れ表示*/
span.inventory_desc {
  color: #666;
  font-size: 120%!important;
}

/*カート　エンド*/

</style>



<style type="text/css">
<!--

div#HeaderKeyword {
	position:absolute;
	top:70px;/*一番上からの位置*/
	left:30px;/*左端からの位置*/
}

div#HeaderKeyword span {
	background: #bf0000;
	color:#fff;
	font-weight:bold;
	padding:2px 5px;
}

div#HeaderKeyword a {
	color:#0044CC;
}

-->
</style>



<div id="HeaderKeyword">
<span>注目のキーワード</span>
<ドッグスリング
ロングリード
高反発マット「むにゅ」
</div>



<style type="text/css">
<!--

span.catch_copy,
span.item_name {
  line-height: 180%;
}

/* 商品名下に境界線が入る */
span.item_name {
    display: block;
    border-bottom: 2px dotted #ddd;
    padding-bottom: 8px;
}

/* 価格に枠線がつく */
table#rakutenLimitedId_cart {
    background-color: #f8f8f8;
    border: 1px solid #ddd;
    padding: 8px;
    margin: 16px 0;
}

span.price1 {
    color: #333 !important;
    font-weight: bold;
    font-size: 80% !important;
    line-height: 30px;
    display: inline-block;
    margin-right: 16px;
}

-->
</style>




<style type="text/css">
<!--
.footer_obi {
background: #339900 none repeat scroll 0% 0%;
position: fixed;
　　z-index:999;
left: 0px;
bottom: 0px;
width: 100%;
text-align: center;
color: #fff;
font-size: 14px;
font-weight: bold;
opacity: 0.9;　/*←値が小さいほど色が薄くなる*/
line-height: 16px;
text-shadow: 0px 1px 0px #5C0000;/*←文字に影をつける*/
padding: 13px 0px;
display: block;
}

@media screen and (-webkit-min-device-pixel-ratio:0) {
.footer_obi {
z-index:99999999;
}
}/*crome用ハック*/

-->
</style>


<div class="footer_obi">
OrangeCafeオリジナル☆ドッグ＆キャットスリング好評発売中！ ★☆★</div>

